                total:0
            }
            ,{ 
                nama:"rinso",
            harga:1000,
            jumlah:0,
            total:0}
        ]
    }
}
render(){
    return(
        <div>
            <h1>belanja</h1>
        </div>
    )
}
}
export default belanja
